import React from 'react';

const Login = () => {
    <div id="login">
        <h3>Login</h3>
        <label>
            Employee ID:
            <input type="text"/>
        </label>
        <label>
            Password:
            <input type="text"/>
        </label>
    </div>

};

export default Login;
